7 -output launcher\nrm -f _launcher6 _launcher7\n\n# Prepare binaries\nrm -f auto.pac\ntar zxf \"${PROJECT_DIR}/MobileShadowSocks/auto.tgz\"\nmkdir -p makedeb/Applications\ncp -r \"${WRAPPER_NAME}\" makedeb/Applications/\nrm -f makedeb/Applications/MobileShadowSocks.app/CodeResources\nln -s _CodeSignature/CodeResources makedeb/Applications/MobileShadowSocks.app/CodeResources\ncp -f auto.pac makedeb/Applications/MobileShadowSocks.app/\ncp -f launcher makedeb/Applications/MobileShadowSocks.app/\ncp -f \"${PROJECT_DIR}/MobileShadowSocks/shadow\" makedeb/Applications/MobileShadowSocks.app/\nchmod 6755 makedeb/Applications/MobileShadowSocks.app/launcher\nchmod 755 makedeb/Applications/MobileShadowSocks.app/shadow\n/usr/bin/plutil -convert binary1 makedeb/Applications/MobileShadowSocks.app/com.linusyang.shadowsocks.plist\nchmod 644 makedeb/Applications/MobileShadowSocks.app/com.linusyang.shadowsocks.plist\nchmod 644 makedeb/Applications/MobileShadowSocks.app/auto.pac\n\n# Make package\nfind . -name .DS_Store | xargs rm -f\nNOWSIZE=\"$(du -s -k makedeb | awk '{print $1}')\"\nCTRLFILE=\"Package: com.linusyang.shadowsocks\\nSection: Networking\\nInstalled-Size: $NOWSIZE\\nAuthor: Linus Yang <laokongzi@gmail.com>\\nArchitecture: iphoneos-arm\\nVersion: $NOWVER-$NOWBUILD\\nDescription: shadowsocks client for iOS\\nName: ShadowSocks\\nHomepage: https://github.com/linusyang/MobileShadowSocks\\nIcon: file:///Applications/MobileShadowSocks.app/Icon.png\\nTag: purpose::uikit\\n\"\nPRERMFILE=\"\\043\\041\\057bin\\057sh\\012find\\040\\057Applications\\057MobileShadowSocks\\056app\\040\\055delete\\012\"\nPOSTFILE='#!/bin/sh\\nBUNDLE=\"/Applications/MobileShadowSocks.app\"\\nchmod 6755 \"${BUNDLE}/launcher\"\\nchmod 755 \"${BUNDLE}/shadow\"\\nchmod 755 \"${BUNDLE}/MobileShadowSocks\"\\nchmod 644 \"${BUNDLE}/com.linusyang.shadowsocks.plist\"\\nchown -R 501:501 \"${BUNDLE}\"\\nchown 0:0 \"${BUNDLE}/launcher\"\\nchown 0:0 \"${BUNDLE}/com.linusyang.shadowsocks.plist\"\\n'\nDEBNAME=\"com.linusyang.shadowsocks_$NOWVER-$NOWBUILD\"\nmkdir -p makedeb/DEBIAN\necho -ne \"${CTRLFILE}\" > makedeb/DEBIAN/control\necho -ne \"${PRERMFILE}\" > makedeb/DEBIAN/prerm\necho -ne \"${POSTFILE}\" > makedeb/DEBIAN/postinst\nchmod 755 makedeb/DEBIAN/prerm\nchmod 755 makedeb/DEBIAN/postinst\n\"${PROJECT_DIR}/MobileShadowSocks/dpkg-deb\" -b makedeb t.deb\nmkdir -p \"${PROJECT_DIR}/release\"\nmv -f t.deb \"${PROJECT_DIR}/release/${DEBNAME}\"_iphoneos-arm.deb\n\n# Clean\nrm -f launcher auto.pac\nrm -rf makedeb\n\nfi\n";
